import axios from 'axios';

const KEY = 'AIzaSyC0RnCGRRsDUVpp0oZ0AQOUfGpHB9mWgnU';

export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3',
    params: {
        part: 'snippet',
        type:'video',
        maxResults : 5,
        key: KEY

    }
});
